  state = {
    votes: 3
  };
  render() {
    return (
      <>
        <button
          onClick={event => this.incrementVotes(this.props, event.target.id)}
          id="articleVote"
        >
          <span role="img" aria-label="thumbsUp">
            VOTE UP üëç
          </span>
        </button>
        <p>VOTE</p>
      </>
    );
  }

  incrementVotes(prop, button) {}

  componentDidUpdate(prevProps) {
    if (prevProps !== this.props) {
      console.log(this.props.articleVotes);
    }
  }
}
